import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="navbar">
      <li>
        <NavLink
          to="/"
        >
          HOME
        </NavLink>
      </li>
      <li>
        <NavLink to="/TopTracks"
                  activeStyle={{
                    fontWeight: "bold",
                    color: "red",
                  }}>Top Tracks</NavLink>
      </li>
      <li>
        <NavLink to="/RecentTracks"
                  activeStyle={{
                    fontWeight: "bold",
                    color: "red",
                  }}>RecentlyPlayed</NavLink>
      </li>
      <li style={{ float: "right" }}>
        {" "}
        <NavLink to="/logout"
                  activeStyle={{
                    fontWeight: "bold",
                    color: "red",
                  }}>Logout</NavLink>
      </li>
    </div>
  );
};

export default Navbar;
